import app from "../Images/app-developement.jpeg";
import ios    from "../Images/ios-developement.jpeg";
import  node  from "../Images/node-js.jpeg";
import  react  from "../Images/react-js.jpeg";
import  full  from "../Images/web-developemnt.jpeg";
import   flutter from "../Images/flutter.jpeg";



const Data =[
    {
        title:"Node-js Development",
        img:node
    },
    {
        title:"App Development",
        img:app
    },
    {
        title:"IOS Development",
        img:ios
    },
    {
        title:"Web Development",
        img:full
    },
    {
        title:"Flutter Development",
        img:flutter
    },
    {
        title:"React-js Development",
        img:react
    }
]

export default Data;
